　●エアコンの主な操作が可能<br>●扇風機などのリモコン信号を1種類だけ記憶できる1ボタン学習機能付き<br>●国内主要メーカー13社対応<br>●夜間の操作に便利なバックライト機能付液晶画面<br>●再設定不要のバックアップ機能搭載<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：ELPA<br>■動作距離：約7m(使用機器や部屋の条件により異なります)<br>■電源：DC3V 単四形乾電池 2本<br>■電池持続時間：約12ヶ月(アルカリ乾電池使用時)※使用頻度により異なります。<br>■外形寸法(約)：幅49.5×高さ155×厚さ20.5(mm)<br>■質量：約76g(乾電池除く)<br>■対応メーカー一覧：FUJITSU GENERAL（富士通ゼネラル）1994年製以降／FUNAI（フナイ）1998年製以降／HITACHI（日立）1994年製以降／MITSUBISHI（三菱）1993年製以降／BEAVER（ビーバー・三菱重工）1994年製以降／Panasonic（パナソニック）1988年製以降／SANYO（サンヨー）1996年製以降／SHARP（シャープ）1997年製以降／TOSHIBA（東芝）1994年製以降／CORONA（コロナ）1999年製以降／DAIKIN（ダイキン）1996年製以降／LG Electronics（LG電子）1996年製以降／CHOFU（長府）対応<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>楽天 通販 リモコン エアコン用 エアコン プラス 扇風機 エルパ お買い得 ■対応メーカー一覧：FUJITSU GENERAL（富士通ゼネラル）1994年製以降／FUNAI（フナイ）1998年製以降／HITACHI（日立）1994年製以降／MITSUBISHI（三菱）1993年製以降／BEAVER（ビーバー・三菱重工）1994年製以降／Panasonic（パナソニック）1988年製以降／SANYO（サンヨー）1996年製以降／SHARP（シャープ）1997年製以降／TOSHIBA（東芝）1994年製以降／CORONA（コロナ）1999年製以降／DAIKIN（ダイキン）1996年製以降／LG Electronics（LG電子）1996年製以降／CHOFU（長府）対応</font></td></tr></table><style type="text/css">
